window.bookSummaryJSON = "<p><i>December, 2042</i></p> <p>The Imperial Legion marches, and war looms on the horizon....</p> <p>Jack Mitchel and his misfit crew of rebels never wanted a fight with the Empire, but the time for diplomacy has passed.&nbsp;</p> <p>Ruthless tech genius Robert Osmark is coming, and trailing behind him is a vast army determined to wipe the Crimson Alliance from the face of Eldgard. Impossibly, Jack has united the warring Murk Elf clans under his banner, but even with their aid, the Alliance is still badly outnumbered, and Osmark has some nasty tricks up his sleeves.</p> <p>And while the long-awaited battle unfolds, an ancient evil stirs in the heart of Viridian Gate Online - one that will change the game forever.</p>"; 
